import styled from "styled-components";
export const Bar = styled.div`
  /* Auto layout */
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
  padding: 4px 4px 4px 16px;
  position: absolute;
  width: 728px;
  height: 48px;
  left: 296px;
  top: 16px;
  background: #FFFFFF;
  border: 1px solid #E0E2EB;
  box-sizing: border-box;
  border-radius: 4px;
`;

export const Placeholder = styled.div`
    position: static;
    width: 600px;
    left: calc(50% - 600px/2 - 48px);
    top: 25%;
    bottom: 25%;
    font-family: 'Inter';
    font-style: normal;
    font-weight: 400;
    font-size: 14px;
    line-height: 24px;
    /* identical to box height, or 171% */
    color: #52597D;
    /* Inside auto layout */
    flex: none;
    order: 0;
    flex-grow: 1;
  margin: 0px 68px;
`;
export const IconButton = styled.div`
  position: static;
  left: 93.96%;
  right: 0.55%;
  top: 8.33%;
  bottom: 8.33%;
  /* Inside auto layout */
  flex: none;
  order: 1;
  flex-grow: 0;
  margin: 0px 68px;
`;
export const Search: React.FC = () => {
  return (
    <Bar>
      <Placeholder>Search by keyword </Placeholder>
      <IconButton />
    </Bar>
  )
}
